import React from 'react';

import Diapo from '../../data/diapo.json';


const Main = (props) => {
  const {textAlternative,selecteur} = Diapo;

  return (
    <main className="container row">
      <div className="">
      {
          textAlternative.map((alter,k) => {
            return (
              <>
              <img key={k}
                alt={alter.textAlternative} />
              </>
            )
          })
      }
    </div>
    </main>
  )
}

export default Main;
